},lvl=60,c=a14}),q(7509,g({qgs={14368},cost={{"i",18492,1}},sourceQuests={7508},maps={234},lvl=60,c=a14},{i(18489,{c=a14,questID=7509,description="Place this in front of Onyxia's Breath attack during The Forging of Quel'Serrar quest.\n\nYou may want to delay placing this item on the ground until the breath goes on cooldown during Phase 3.\n\nAs a note you can heat the blade in Phase 1 or 3. The Heated Ancient Blade has a deteriation time of 20 minutes. This is NOT a cooldown. Once the time runs out it will not change back into the Unfired Ancient Blade. It will instead disappear from your inventory and you will have to get a replacement for it by returning to DM, abandoning the quest, and reaccepting.",b=1}),i(18488,{c=a14,questID=7509,description="Once the boss uses her Breath attack on your Unfired Ancient Blade, loot this item from the ground and then impale the corpse of Onyxia once you defeat her.",b=4}),i(18492,{crs={10184},c=a14,questID=7509,description="Drops from Onyxia when you use the Heated Ancient Blade on her corpse during The Forging of Quel'Serrar quest.",b=4}),i(18348,{lvl=60,b=1})})),q(7497,g({qgs={14394},sourceQuests={7496},lvl=60,requireSkill=165,races=a1},{r(19093,{itemID=15769,requireSkill=165})})),q(7493,g({qgs={14392},sourceQuests={7491},lvl=60,requireSkill=165,races=a2},{r(19093,{itemID=15769,requireSkill=165})})),q(7495,{providers={{"i",18423}},races=a1}),q(7490,{providers={{"i",18422}},races=a2})}),n(10184,{i(18423,{questID=7495,races=a1,lvl=60,b=1}),i(18422,{questID=7490,races=a2,lvl=60,b=1}),i(18705,{lvl=60,c=a6,questID=7635,b=4}),i(21108,{lvl=60,u=3,questID=8620,description="This item only drops while on the quest 'The Only Prescription'.",b=1}),i(17966,{b=1}),i(17068,{lvl=60,b=1}),i(17075,{lvl=60,b=1}),i(17067,{lvl=60,b=1}),i(16908,{lvl=60,b=1}),i(16939,{lvl=60,b=1}),i(16921,{lvl=60,b=1}),i(16963,{lvl=60,b=1}),i(16947,{lvl=60,b=1}),i(16955,{lvl=60,b=1}),i(16929,{lvl=60,b=1}),i(16914,{lvl=60,b=1}),i(16900,{lvl=60,b=1}),i(18205,{lvl=60,b