tinsert(l,m(213,g({lvl=13,coords={{50.6,51.6,1454}},description="Ragefire Chasm consists of a network of volcanic caverns that lie below the orcs' new capital city of Orgrimmar. Recently, rumors have spread that a cult loyal to the demonic Shadow Council has taken up residence within the Chasm's fiery depths. This cult, known as the Burning Blade, threatens the very sovereignty of Durotar. Many believe that the orc Warchief, Thrall, is aware of the Blade's existence and has chosen not to destroy it in the hopes that its members might lead him straight to the Shadow Council. Either way, the dark powers emanating from Ragefire Chasm could undo all that the orcs have fought to attain"},{n(-17,{q(5726,{qgs={4949},coords={{32,37.8,1454}},maps={1454},lvl=9,races=a2}),q(5727,{qgs={4949},sourceQuests={5726},maps={1454},lvl=9,races=a2,coords={{32,37.8,1454}}}),q(5728,{qgs={4949},sourceQuests={5727},maps={1454},lvl=9,races=a2,coords={{32,37.8,1454}}}),q(5729,{qgs={4949},sourceQuests={5728},maps={1454},lvl=9,races=a2,coords={{32,37.8,1454}}}),q(5730,g({qgs={3216},lvl=9,sourceQuests={5729},maps={1454},races=a2,coords={{49.6,50.6,1454}}},{i(15424,{b=1}),i(15445,{b=1}),i(15443,{b=1}),i(15444,{b=1})})),q(5724,g({qgs={11834},sourceQuests={5722},lvl=9,races=a2},{i(15452,{b=1}),i(15453,{b=1})})),q(5722,{qgs={11833},coords={{70.6,31.4,1456}},maps={1456},lvl=9,races=a2}),q(5761,{qgs={3216},sourceQuests={5727},maps={1454},lvl=9,races=a2,coords={{49.6,50.6,1454}}}),q(5723,{qgs={11833},coords={{70.6,31.4,1456}},maps={1456},lvl=9,races=a2}),q(5725,g({qgs={2425},coords={{56.2,91.8,1458}},maps={1458},lvl=9,races=a2},{i(15450,{b=1}),i(15451,{b=1}),i(15449,{b=1})}))}),n(11517,{i(2589)}),n(11520,{i(14540,{b=4}),i(14145,{lvl=13,b=1}),i(14149,{lvl=13,b=1}),i(14148,{lvl=13,b=1})}),n(11518,{i(14151,{lvl=13,b=1}),i(14150,{lvl=13,b=1}),i(14147,{lvl=13,b=1})}),n(11519,{description="Drops nothing of note."})})));
tinsert(l,m(300,g({lvl=25,coords={{50,92,1413}},description="Crafted from the same mighty vines as Razorfen Kraul, Razorfen Downs is the traditional capital city of the quillboar race. The sprawling, thorn-ridden labyrinth houses a veritable army of loyal quillboar as well as their high priests - the Death's Head tribe. Recently, however, a looming shadow has fallen over the crude den. Agents of the undead Scourge - led by the lich, Amnennar the Coldbringer - have taken control over the quillboar race and turned the maze of thorns into a bastion of undead might. Now the quillboar fight a desperate battle to reclaim their beloved city before Amnennar spreads his control across the Barrens."},{n(-17,{q(6626,{lvl=28,coords={{49,94,1413}},maps={1413},qgs={12866}}),q(3341,g({qgs={2308},coords={{74,32.8,1458}},maps={1458},lvl=37,races=a2},{i(10823,{b=1}),i(10824,{b=1})})),q(3636,g({qgs={1284},coords={{39.6,27.4,1453}},maps={1453},lvl=39,races=a1},{i(10823,{b=1}),i(10824,{b=1})})),q(3525,g({qgs={8516},sourceQuests={3523},lvl=32,races=a2},{i(10710,{b=1})})),q(3523,{qgs={8516},lvl=32,races=a2})}),n(0,{i(10573,{lvl=32,b=2}),i(10582,{lvl=31,b=2}),i(10574,{lvl=35,b=2}),i(10581,{lvl=35,b=2}),i(10571,{lvl=32,b=2}),i(10572,{lvl=34,b=2}),i(10570,{lvl=34,b=2}),i(10567,{lvl=33,b=2}),i(10583,{lvl=34,b=2}),i(10584,{lvl=31,b=2}),i(10578,{lvl=33,b=2})}),n(7355,{i(10776,{lvl=35,b=1}),i(10775,{lvl=40,b=1}),i(10777,{lvl=37,b=1})}),n(7356,{i(10766,{lvl=35,b=1}),i(10760,{lvl=34,b=1})}),n(8696,g({description="The only source of acquiring Goldthorn Tea."},{r(13028,{requireSkill=185})})),n(7357,{i(10770,{lvl=36,b=1}),i(10769,{lvl=36,b=1}),i(10771,{lvl=36,b=1})}),n(7354,g({description="This is a rare spawn that is not always present."},{i(10758,{lvl=35,b=1}),i(10767,{lvl=37,b=1}),i(10768,{lvl=37,b=1})})),n(8567,{i(10772,{lvl=36,b=1}),i(10774,{lvl=37,b=1})}),n(7358,{i(10420,{questID=3341,races=a2,b=4}),i(10761,{lvl=39,b=1}),i(10763,{lvl=40,b=1}),i(10764,{lvl=39,b=1}),i(10762,{lvl=39,b=1}),i(10765,