tinsert(l,m(301,g({lvl=17,coords={{40.94,94.55,1413}},description="Ten thousand years ago - during the War of the Ancients, the mighty demigod, Agamaggan, came forth to battle the Burning Legion. Though the colossal boar fell in combat, his actions helped save Azeroth from ruin. Yet over time, in the areas where his blood fell, massive thorn-ridden vines sprouted from the earth. \n\nThe quillboar - believed to be the mortal offspring of the mighty god, came to occupy these regions and hold them sacred. The heart of these thorn-colonies was known as the Razorfen. The great mass of Razorfen Kraul was conquered by the old crone, Charlga Razorflank. Under her rule, the shamanistic quillboar stage attacks on rival tribes as well as Horde villages. Some speculate that Charlga has even been negotiating with agents of the Scourge - aligning her unsuspecting tribe with the ranks of the Undead for some insidious purpose."},{n(-17,{q(1102,g({qgs={4451},coords={{37.1,29,1412}},maps={1456},lvl=29,races=a2},{i(6725,{b=1}),i(4197,{b=1}),i(6742,{b=1})})),q(6522,{qgs={2425},coords={{56.3,92.2,1458}},maps={1458},lvl=28,races=a2}),q(6521,g({qgs={2425},lvl=28,sourceQuests={6522},maps={1458},races=a2,coords={{56.3,92.2,1458}}},{n(12865,g({coords={{48.6,95.6,1413}}},{i(17009,{b=4})})),i(17039,{b=1}),i(17042,{b=1}),i(17043,{b=1})})),q(1221,g({qgs={3446},coords={{62.4,37.6,1413}},maps={1413},lvl=20},{i(5880,{b=4}),i(5897,{b=4}),i(6684,{b=4}),i(6755,g({b=1},{i(6756,{b=1})}))})),q(1109,{qgs={2055},coords={{49,69.8,1458}},maps={1458},lvl=30,races=a2}),q(1142,g({qgs={4510},coords={{69.4,67.6,1438}},lvl=25,races=a1},{i(6751,{b=1}),i(6752,{b=1})})),q(1101,g({qgs={4048},lvl=29,sourceQuests={1100},maps={1444},races=a1,coords={{89.6,46.6,1444}}},{i(6725,{b=1}),i(4197,{b=1}),i(6742,{b=1}),i(3041,{lvl=26,b=2})})),q(1144,g({qgs={4508},lvl=22},{i(6748,{b=1}),i(6750,{b=1}),i(6749,{b=1})}))}),n(0,{i(5876,{races=a2,description="Acquired by using the Snufflenose Command Stick after releasing a gopher using