tinsert(l,m(310,g({lvl=14,coords={{36.6,65.6,1421}},description="During the Third War, the wizards of the Kirin Tor battled against the undead armies of the Scourge. When the wizards of Dalaran died in battle, they would rise soon after - adding their former might to the growing Scourge. Frustrated by their lack of progress (and against the advice of his peers) the Archmage, Arugal elected to summon extra-dimensional entities to bolster Dalaran's diminishing ranks. Arugal's summoning brought the ravenous worgen into the world of Azeroth. The feral wolf-men slaughtered not only the Scourge, but quickly turned on the wizards themselves. The worgen sieged the keep of the noble, Baron Silverlaine. Situated above the tiny hamlet of Pyrewood, the keep quickly fell into shadow and ruin. Driven mad with guilt, Arugal adopted the worgen as his children and retreated to the newly dubbed 'Shadowfang Keep'. It's said he still resides there, protected by his massive pet, Fenrus - and haunted by the vengeful ghost of Baron Silverlaine."},{n(-17,{q(1014,g({qgs={1938},races=a2,maps={1421},lvl=18,coords={{44.2,39.8,1421}}},{i(6414,{b=1})})),q(1098,g({qgs={1952},races=a2,maps={1421},lvl=18,coords={{43.4,40.8,1421}}},{i(3324,{b=1})})),q(1013,g({qgs={2934},races=a2,maps={1458},lvl=16,coords={{54,54.6,1458}}},{i(4534,{b=1}),i(6335,{b=1})})),q(1740,g({qgs={6247},coords={{49.2,57.2,1413}},c=a3,lvl=20,maps={1413}},{i(6898,{b=1}),i(15109,{b=1})})),q(1794,{qgs={5149},races=a6,c=a10,lvl=20,maps={1455},coords={{23.6,6.4,1455}}}),q(1793,{qgs={6171},races=a5,c=a10,lvl=20,maps={1453},coords={{39.8,30.8,1453}}}),i(6776,{questID=1649,qgs={6171},c=a10,lvl=20,races=a16,maps={1453},sourceQuests={1793,1794},coords={{39.8,30.8,1453}},b=1}),q(1650,{qgs={6171},lvl=20,sourceQuests={1649},c=a10,maps={1453},coords={{39.8,30.8,1453}},races=a16}),q(1651,{qgs={6182},lvl=20,sourceQuests={1650},c=a10,maps={1436},coords={{42.4,88.4,1436}},races=a16}),q(1652,g({qgs={6171},c=a10,lvl=20,races=a16,maps={1453},coords={