tinsert(l,m(220,g({lvl=45,description="Over a thousand years ago, the powerful Gurubashi Empire was torn apart by a massive civil war. An influential group of troll priests, known as the Atal'ai, attempted to bring back an ancient blood god named Hakkar the Soulflayer. Though the priests were defeated and ultimately exiled, the great troll empire buckled in upon itself. The exiled priests fled far to the north, into the Swamp of Sorrows. There they erected a great temple to Hakkar - where they could prepare for his arrival into the physical world. The great dragon Aspect, Ysera, learned of the Atal'ai's plans and smashed the temple beneath the marshes. To this day, the temple's drowned ruins are guarded by the green dragons who prevent anyone from getting in or out. However, it is believed that some of the fanatical Atal'ai may have survived Ysera's wrath - and recommitted themselves to the dark service of Hakkar."},{n(-17,{q(9053,g({u=3,qgs={9619},c=a9,sourceQuests={9051},maps={1449},cost={{"i",22444,1}},coords={{71.6,76,1449}}},{i(22272,{b=1}),i(22274,{b=1}),i(22458,{b=1})})),q(8257,g({u=3,qgs={8405},c=a7,lvl=50,sourceQuests={8256},maps={1447},cost={{"i",20025,1}},coords={{42.2,42.6,1447}}},{i(19990,{b=1}),i(20006,{b=1}),i(20082,{b=1})})),q(8413,g({u=3,qgs={6176},c=a11,sourceQuests={8412},maps={1416},cost={{"i",20606,2},{"i",20607,2},{"i",20608,2}}},{i(20369,{b=1}),i(20503,{b=1}),i(20556,{b=1})})),q(8253,g({u=3,qgs={8379},c=a8,lvl=50,coords={{29.6,40.6,1447}},maps={1447},cost={{"i",20085,1}},sourceQuests={8252}},{i(20035,{b=1}),i(20036,{b=1}),i(20037,{b=1})})),q(8418,g({u=3,qgs={10838},c=a10,sourceQuests={8416},maps={1422},cost={{"i",20606,2},{"i",20607,2},{"i",20608,2}},races=a1,coords={{42.8,84,1422}}},{i(20504,{lvl=47,b=1}),i(20505,{b=1}),i(20512,{b=1}),i(20620,{b=1})})),q(4143,{qgs={7775},sourceQuests={4142},maps={1444},lvl=47,races=a1,coords={{45.1,25.6,1444}}}),q(3512,{qgs={5353},sourceQuests={3374},maps={1435},lvl=48,coords={{13.67,71.72,1435}},description=