tinsert(l,m(279,g({lvl=10,coords={{45.9,35.7,1413}},description="Recently, a night elf druid named Naralex discovered a network of underground caverns within the heart of the Barrens. Dubbed the 'Wailing Caverns', these natural caves were filled with steam fissures which produced long, mournful wails as they vented. Naralex believed he could use the caverns' underground springs to restore lushness and fertility to the Barrens - but to do so would require siphoning the energies of the fabled Emerald Dream.\n\nOnce connected to the Dream, however, the druid's vision somehow became a nightmare. Soon the Wailing Caverns began to change - the waters turned foul and the once-docile creatures inside metamorphosed into vicious, deadly predators. It is said that Naralex himself still resides somewhere inside the heart of the labyrinth, trapped beyond the edges of the Emerald Dream. Even his former acolytes have been corrupted by their master's waking nightmare - transformed into the wicked Druids of the Fang."},{n(-17,g({description="To get to the quest giver hub outside the instance:\n\nWhen facing the mouth of the cave, you should see that the entrance looks like a skull. The questgivers are in the left eye. To get there, climb up the mountain, drop onto the head, drop onto the brow, drop onto the nose, face the instance, and go into the eye on the left"},{q(1487,g({qgs={5768},coords={{46,35.7,1413}},maps={1413},lvl=15},{r(7955,{itemID=6476,requireSkill=165}),i(8071,{b=1}),i(6481,{b=1})})),q(1486,g({qgs={5767},coords={{46,35.7,1413}},maps={1413},lvl=13},{i(6480,{b=1}),i(918,{b=1})})),q(1489,{qgs={3448},sourceQuests={880},maps={1413},lvl=10,races=a2,coords={{52.3,31.9,1413}}}),q(3370,g({altQuestID=3369,qgs={8418},description="She lives in a house on top of the mountain.",lvl=15,sourceQuests={6981},maps={1413},coords={{48.2,32.8,1413}}},{i(10657,{b=1}),i(10658,{b=1})})),q(914,g({qgs={5770},races=a2,sourceQuests={1490},coords={{45.2,23.3,1412},{75,31,1456}},lvl=10,maps={1412,